import { Box, Button, Grid, Typography } from "@mui/material"
import { styled } from '@mui/material/styles';
import { useEffect, useState } from "react"
import Paciente from '../cita_semanal/Paciente'
import useAuth from "src/hooks/useAuth";
import useLayoutContext from "src/hooks/useAuthLayout";
import ReactQuill from 'react-quill';
import 'react-quill/dist/quill.snow.css';
import axios from "axios";
import swal from "sweetalert";

const EditorWrapper = styled(Box)(
    ({ theme }) => `
  
      .ql-editor {
        min-height: 100px;
      }
  
      .ql-toolbar.ql-snow {
        border-top-left-radius: ${theme.general.borderRadius};
        border-top-right-radius: ${theme.general.borderRadius};
      }
  
      .ql-toolbar.ql-snow,
      .ql-container.ql-snow {
        border-color: ${theme.colors.alpha.black[30]};
      }
  
      .ql-container.ql-snow {
        border-bottom-left-radius: ${theme.general.borderRadius};
        border-bottom-right-radius: ${theme.general.borderRadius};
      }
  
      &:hover {
        .ql-toolbar.ql-snow,
        .ql-container.ql-snow {
          border-color: ${theme.colors.alpha.black[50]};
        }
      }
  `
);

export default function Index() {
    const { user } = useAuth()
    const { mostrarComponent } = useLayoutContext()
    const [selected, setSelected] = useState({ paciente: { item: null, selected: false } })
    const [text, setText] = useState('')
    const handleChangeText = (content, delta, source, editor) => {
        setText(editor.getHTML())
    }

    const [firma, setFirma] = useState('')
    useEffect(() => {
        console.log(firma);
    }, [firma])
    useEffect(() => {
        if (user.datos.numero_documento === '43593169') {
            setFirma(`data:image/png;base64,`)
        }

    }, [user])

    const handleSleccionarPaciente = (id, item) => {
        setSelected(x => {
            return {
                ...x,
                [id]: {
                    item,
                    selected: true
                }
            }
        })
    }
    const handleLimpiarAll = () => {
        setSelected({ paciente: { item: null, selected: false } })
    }
    const handleGuardar = async () => {

        let persona = selected.paciente.item
        let fecha = new Date().toISOString().split('T')[0]
        let nombres = persona.Des_ApePaterno + ' ' + persona.Des_ApeMaterno + ' ' + persona.Des_Nombres
        let html = `
        <style>
        h1 { font-family: Arial, "Helvetica Neue", Helvetica, sans-serif; font-size: 24px; font-style: normal; font-variant: normal; font-weight: 700; line-height: 26.4px; } h3 { font-family: Arial, "Helvetica Neue", Helvetica, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: 700; line-height: 15.4px; } 
        p { font-family: Arial, "Helvetica Neue", Helvetica, sans-serif; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; line-height: 20px; } blockquote { font-family: Arial, "Helvetica Neue", Helvetica, sans-serif; font-size: 21px; font-style: normal; font-variant: normal; font-weight: 400; line-height: 30px; } pre { font-family: Arial, "Helvetica Neue", Helvetica, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: 400; line-height: 18.5714px; }
        </style>
        
        <div style="padding:30px;">
        <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;${nombres}&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;${persona.Nro_Historia}</p>
        <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Julio Ramon M.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp</p>
        ${text}
        <p style="text-align: right;">Atentamente</p>
        <p style="text-align: right;">
            <img src="${firma}"  width="200" height="200"/>
        </p>
        </div>
       `
        const enviar = await axios.post(`http://200.121.91.211:4001/generarPdf2`, {
            contenido: html,
            historia: persona.Nro_Historia,
            documento: user.datos.numero_documento,
            ruta: '\\PATOLOGIA\\',
            rutaTexto: 'PATOLOGIA',
            titulo: nombres + '_' + fecha
        })
        if (enviar.status === 200) {
            mostrarComponent({
                contenido: '',
                estado: false,
            }, 'drawerOpen')
            swal({
                title: 'Correcto',
                text: 'Genero su resultado médico sin nigun inconveniente',
                icon: 'success',
                buttons: false,
                timer: 1200
            })
        }

    }

    return (
        <>
            {!selected.paciente.selected && <Paciente handleSleccionarPaciente={handleSleccionarPaciente} />}
            {selected.paciente.selected && <>
                <Grid alignItems="center" justifyContent={"center"} container spacing={3} sx={{ p: 2 }}>
                    <Grid item xs={12} lg={10} md={10}>
                        <Box display="flex" alignItems="center">
                            <Box ml={1.5}>
                                <Typography color="text.primary" variant="h4" noWrap>
                                    {selected.paciente.item.Des_ApePaterno + ' ' + selected.paciente.item.Des_ApeMaterno + ' ' + selected.paciente.item.Des_Nombres}
                                </Typography>
                                <Typography variant="subtitle1" noWrap>
                                    {selected.paciente.item.Nro_DocIdenti}
                                </Typography>
                            </Box>
                        </Box>
                    </Grid>
                    <Grid item xs={12} lg={2} md={2}>
                        <Button variant="outlined" size='small' sx={{ float: 'right' }}
                            onClick={() => handleLimpiarAll()}>
                            Limpiar
                        </Button>
                    </Grid>
                    <Grid item xs={12} lg={12} md={12} >
                        <EditorWrapper>
                            <ReactQuill
                                value={text}
                                onChange={handleChangeText}
                                modules={{
                                    toolbar: [
                                        [{ 'header': [] }, { 'font': [] }],
                                        [{ size: [] }],
                                        ['bold', 'italic', 'underline', 'strike', 'blockquote'],
                                        [
                                            { 'list': 'ordered' },
                                            { 'list': 'bullet' },
                                            { 'indent': '-1' },
                                            { 'indent': '+1' },
                                        ],
                                        ['link', 'image', 'video'],
                                        ['clean'],
                                        [{ 'color': [] }, { 'background': [] }],
                                        [{ align: '' }, { align: 'center' }, { align: 'right' }, { align: 'justify' }],
                                        // [],
                                    ],
                                    clipboard: {
                                        // toggle to add extra line breaks when pasting HTML:
                                        matchVisual: false,
                                    },
                                }}
                                formats={[
                                    'header', 'font', 'size', 'color',
                                    'bold', 'italic', 'underline', 'strike', 'blockquote',
                                    'list', 'bullet', 'indent',
                                    'link', 'image', 'video',
                                    'align',
                                ]}
                            />
                        </EditorWrapper>
                    </Grid>


                    <Grid item xs={12} lg={12} md={12} sx={{ mt: 2 }}>
                        <Button variant="contained" size='small' fullWidth p={2}
                            onClick={() => handleGuardar()}
                        >
                            Generar
                        </Button>
                    </Grid>
                </Grid>

            </>}
        </>
    )
}
